  return (
    <div className="main-container">
      <img src="{logo}" alt="Tindev" />
      <ul>
        <li>
          <img src="https://avatars2.githubusercontent.com/u/10776256?v=4" alt=""/>
          <footer>
            <strong>Cristiano Oliveira</strong>
            <p>Texto da bio do usu√°rio</p>
          </footer>
          <div className="buttons">
            <button type="button">
              <img src="{dislike}" alt="Dislike"/>
            </button>
            <button type="button">
              <img src="{like}" alt="Dislike"/>
            </button>
          </div>
        </li>
      </ul>
    </div>
  );
}
